import React from 'react'
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Homepage from './pages/homepage'


function App() {
  return (
    <BrowserRouter>
      <div>
        <Routes path={"/"} component={Homepage} exact />
      </div>
    </BrowserRouter>
  );
}

export default App;
